ControlPropertyState.AutoRuleBindingString:
UpdateContext({
    tokenSearchResponse: '[DEV]똑실이-[Apps]AIGraph토큰사용성분석'.Run(
        If(
            Dropdown_GalleryFilter_CategoryLV1_AIGraph_DEV_1.Selected.Value = DEFAULT_CATEGORY_VALUE && Dropdown_GalleryFilter_CategoryLV2_AIGraph_DEV_1.Selected.Value = DEFAULT_CATEGORY_VALUE,
            // LV1=전체 LV2=전체 일경우
            "/" & Substitute(Concatenate(Concat(LastN(colCategoryAdmin,CountRows(colCategoryAdmin)-1), Category_LV1LV2 & "?"),"delete_point"),"?delete_point",""),
            // 카테고리LV1만 선택한 경우
            If(
                Dropdown_GalleryFilter_CategoryLV1_AIGraph_DEV_1.Selected.Value <> DEFAULT_CATEGORY_VALUE && Dropdown_GalleryFilter_CategoryLV2_AIGraph_DEV_1.Selected.Value = DEFAULT_CATEGORY_VALUE,
                Substitute(Concatenate(Concat(Filter(LastN(colCategoryAdmin,CountRows(colCategoryAdmin)-1),Category_LV1 = Text(Dropdown_GalleryFilter_CategoryLV1_AIGraph_DEV_1.Selected.Value)), Category_LV1LV2 & "?"),"delete_point"),"?delete_point",""),
                // 카테고리LV2만 선택한 경우
                If(
                    Dropdown_GalleryFilter_CategoryLV1_AIGraph_DEV_1.Selected.Value = DEFAULT_CATEGORY_VALUE && Dropdown_GalleryFilter_CategoryLV2_AIGraph_DEV_1.Selected.Value <> DEFAULT_CATEGORY_VALUE,
                    Substitute(Concatenate(Concat(Filter(LastN(colCategoryAdmin,CountRows(colCategoryAdmin)-1),Category_LV2 = Text(Dropdown_GalleryFilter_CategoryLV2_AIGraph_DEV_1.Selected.Value)), Category_LV1LV2 & "?"),"delete_point"),"?delete_point",""),
                    // LV1, LV2 둘다 선택한 경우
                    Dropdown_GalleryFilter_CategoryLV1_AIGraph_DEV_1.Selected.Value & "/" & Dropdown_GalleryFilter_CategoryLV2_AIGraph_DEV_1.Selected.Value
                )
            )
        )
        ,{
        // StartDate
        text_1: Text(DatePicker_SearchDateMin_TokenMenu_1.SelectedDate, "yyyy-mm-dd"),
        // EndDate
        text_2: Text(DatePicker_SearchDateMax_TokenMenu_1.SelectedDate, "yyyy-mm-dd")
    }).result_json
});

ClearCollect(
    tokenSearchResult_1,
    ForAll(
        Table(ParseJSON(tokenSearchResponse)),
        {
            Category_LV1: Text(ThisRecord.Value.Category_LV1),
            Category_LV2: Text(ThisRecord.Value.Category_LV2),
            Token_Question: Text(ThisRecord.Value.Token_Question),
            Token_Answer: Text(ThisRecord.Value.Token_Answer),
            //Token_Date: Text(ThisRecord.Value.Token_Date, "yyyy-mm-dd"),
            Token_Date: Text(DateAdd(ThisRecord.Value.Token_Date, -TimeZoneOffset(), TimeUnit.Minutes), "yyyy-mm-dd"),
            Token_Input: Text(ThisRecord.Value.Token_Input),
            Token_Output: Text(ThisRecord.Value.Token_Output),
            Token_Total: Text(ThisRecord.Value.Token_Total),
            ID: Int(ThisRecord.Value.ID)
        }
    )
);

UpdateContext({ 
    locLoadingSpinner: false
});
